import React from "react";
import { Element } from "react-scroll";
import styled from "styled-components";
import { SectionTitle } from "../../components/sectionTitle";
import AboutImgUrl from "../../assets/pictures/MoreImages/background_shoe.svg";
import {

    createMuiTheme,
    responsiveFontSizes,
    MuiThemeProvider,
    Typography
} from "@material-ui/core";

let theme = createMuiTheme();
theme = responsiveFontSizes(theme);

const MoreAboutContainer = styled(Element)`
    min-height: 500px;
    display: flex;
    flex-direction: column;
    align-items: center;
    font-family: 'Arimo', sans-serif;
    margin-top: 200px;
    text-align: center;
`;

const AboutImg = styled.img`
    width: 400px;
    height: 200px;
    margin-bottom: 40px;
`;

const heading = "About Sneak Peek";
const line1 = "Sneak Peek is an online destination to";
const line2 = "discover upcoming Men's & Womens's";
const line3 = "Sneakers from the best fashion brands,";
const line3n = "stores, and boutiques around the world.";
const line3n2 = "At Sneak Peek we offer the most unique";
const line3n3 = "way of viewing and saving dates for your";
const line3n4 = "favorite sneaker releases!";
const line4 = "Our aim is to create a place for customers";
const line4n1 = "to discover their favorite sneakers.";
const line5 = "The vision that embodies Sneak Peek is to";
const line5n1 = "provide our customers with the best";
const line6 = "experience and to build a strong platform in";
const line6n1 ="the mobile application market.";

export function MoreAboutSneakPeek(props) {
    return <MoreAboutContainer>
            <MuiThemeProvider theme={theme}>
                <Typography style={{ fontWeight: "bold", fontFamily: 'Arimo' }} variant="h2" gutterBottom>
                    {heading}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo' }} variant="h7" gutterBottom>
                    {line1}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo' }} variant="h7" gutterBottom>
                    {line2}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo' }} variant="h7" gutterBottom>
                    {line3}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo'}} variant="h7" gutterBottom>
                    {line3n}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo'}} variant="h7" gutterBottom>
                    {line3n2}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo'}} variant="h7" gutterBottom>
                    {line3n3}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo', paddingBottom: '50px'}} variant="h7" gutterBottom>
                    {line3n4}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo' }} variant="h7" gutterBottom>
                    {line4}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo' }} variant="h7" gutterBottom>
                    {line4n1}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo' }} variant="h7" gutterBottom>
                    {line5}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo' }} variant="h7" gutterBottom>
                    {line5n1}
                </Typography>

                <Typography style={{ fontFamily: 'Arimo', paddingBottom: '80px' }} variant="h7" gutterBottom>
                    {line6}
                </Typography>

                <AboutImg src={AboutImgUrl} />
            </MuiThemeProvider>
    </MoreAboutContainer>
}
